import React from 'react';
import Layout from '../../layout/layout';

export default function Home() {
  return (
    <div id="home">
      <div className="header">
        <Header />
        <div className="contact">
          <div className="section left">
            <Sidebar />
          </div>
          <div className="section right">
            <Sidebar />
          </div>
        </div>
        <div className="footer">
        <Footer />
      </div>
      </div>
    </div>
  );
}
